import  {   BrowserRouter,  Routes, Route   }   from    'react-router-dom';
import  AthleteProfile  from    './pages/AthleteProfile/AthleteProfile.jsx';

function App()  {
    return  (
        <BrowserRouter>
            <Routes>
                <Route path="/profiles/:id" element={<AthleteProfile    />} />
                {/* fallback    to  id=1    if  you like:   */}
                <Route  path="*"    element={<AthleteProfile    />} />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
